{"post_stream":{"posts":[{"id":3371890,"name":"","username":"uncoolin","avatar_template":"/user_avatar/www.chiefdelphi.com/uncoolin/{size}/224822_2.png","created_at":"2024-04-24T03:04:06.770Z","cooked":"<p>I’m having some issues implementing a Vision utility class. We use PhotonVision, and for some reason, when adding vision measurements the SwerveDrivePoseEstimator. It works for a few moments, but after seeing a tag for a few seconds, it throws a ConcurrentModificationException error. Here is the stack trace:</p>
<pre><code class="lang-auto">at frc.robot.Main.main(Main.java:13) 
at edu.wpi.first.wpilibj.RobotBase.startRobot(RobotBase.java:453)
at edu.wpi.first.wpilibj.RobotBase.runRobot(RobotBase.java:365) 
at org.littletonrobotics.junction.LoggedRobot.startCompetition(LoggedRobot.java:11) 
at edu.wpi.first.wpilibj.IterativeRobotBase.loopFunc(IterativeRobotBase.java:381)
at frc.robot.Robot.robotPeriodic(Robot.java:31)
at edu.wpi.first.wpilibj2.command.CommandScheduler.run(CommandScheduler.java:260) 
at frc.robot.subsystems.Drivetrain.periodic(Drivetrain.java:83)
at java.base/java.util.ArrayList.forEach(Unknown Source)
at frc.robot.subsystems.Drivetrain.lambda$periodic$0(Drivetrain.java:84)
at edu.wpi.first.math.estimator.PoseEstimator.addVisionMeasurement(PoseEstimator.java:191)
at java.base/java.util.TreeMap$NavigableSubMap$SubMapEntryIterator.next(Unknown Source)
at java.base/java.util.TreeMap$NavigableSubMap$SubMapEntryIterator.next(Unknown Source)
at java.base/java.util.TreeMap$NavigableSubMap$SubMapIterator.nextEntry(Unknown Source)
java.util.ConcurrentModificationException
</code></pre>
<p>And here is the code that is running in Drivetrain.periodic():</p>
<pre><code class="lang-auto">m_Vision.getVisionMeasurements().forEach(pose -&gt; {
      this.m_odometry.addVisionMeasurement(pose.estimatedPose.toPose2d(), pose.timestampSeconds);
</code></pre>
<p>And the function within the vision class:</p>
<pre><code class="lang-auto">public ArrayList&lt;EstimatedRobotPose&gt; getVisionMeasurements()
    {
        ArrayList&lt;EstimatedRobotPose&gt; estimatedPoses = new ArrayList&lt;EstimatedRobotPose&gt;();

        if (visionEnabled &amp;&amp; !m_Cameras.isEmpty())
        {
            m_Cameras.forEach(camera -&gt;
            {
                if (camera.m_Camera.isConnected() &amp;&amp; camera.getEnabled())
                {
                    Optional&lt;EstimatedRobotPose&gt; pose = camera.getEstimatedPose();

                    if (pose.isPresent())
                    {
                        estimatedPoses.add(pose.get());
                    }
                }
            });   
        }

        return estimatedPoses;
    }
</code></pre>
<p>I can’t seem to figure out what is causing this to occur. I saw a Github issue with a similar problem, but it was a year ago and their issue seems to have been fixed in a pull request.</p>
